import IconModal from "../../UI/IconModal";

const DropDownButton = props => (
    <IconModal viewBox="0 0 12 7" {...props}>
        <path d="M6 1L1.75736 5.24264" stroke="white" strokeWidth="2" strokeLinecap="round"/>
        <path d="M10.2427 5.24265L6.00004 1" stroke="white" strokeWidth="2" strokeLinecap="round"/>
    </IconModal>
);

export default DropDownButton;
